import React from 'react';
import Link from "./Link.js";

function openTermAndConditions() {
    console.log("Term and conditions");
}

class Register extends React.Component {

    render() {
        return (<div className="register_container">
                <form className="form_register">
                    <label className="input_label">
                        Name
                        <input required type="text"/>
                    </label>
                    <label className="input_label">
                        Email
                        <input required type="email"/>
                    </label>
                    <label className="input_label">
                        Password
                        <input required type="password"/>
                    </label>
                    <label className="input_label">
                        Birthdate
                        <input required type="date"/>
                    </label>
                    <div>
                        I accept <a onClick={openTermAndConditions} className="form_link">Terms and Conditions</a>
                    </div>
                    <input required type="checkbox" name="gdpr"/>

                    <input className="button_submit" type="Submit"/>
                </form>
            </div>
        )
    }
}


export default Register;
